import React from "react";
import { BrowserRouter, Link, Routes, Route } from "react-router-dom";
import { useHistory } from "react-router-dom";

function App() {
  return (
    <BrowserRouter basename="">
      <Routes>
        <Route>
          <Link to="/">home </Link>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
